import React from 'react';
import './App.css';
import SearchBox from './Searchbox';

function App() {
    return (
        <div className="hero-section">
            <header>
                <div className="logo">Ascenda</div>
                <nav>
                    <ul>
                        <li><a href="#">Home</a></li>
                        <li><a href="#">About</a></li>
                        <li><a href="#">Login</a></li>
                    </ul>
                </nav>
            </header>
            <div className="content">
                <h1>Get Ready to Explore the World with <span>Ascenda</span></h1>
                <SearchBox />
            </div>
        </div>
    );
}

export default App;
